# flower_finder
from collections import deque

vowels = deque(input().split())
consonants = deque(input().split())

words ={
    "rose": "rose",
    "tulip": "tulip",
    "lotus": "lotus",
    "daffodil": "dafodil"
}

while vowels and consonants:
    vowel = vowels.popleft()
    consonant = consonants.pop()

    for word in words:
        words[word] = words[word].replace(vowel, "")
        words[word] = words[word].replace(consonant, "")

        if not words[word]:
            print(f"Word found: {word}")
            break

    else:
        continue

    break

else:
    print("Cannot find any word!")

if vowels:
    print(f"Vowels left: {' '.join(vowels)}")

if consonants:
    print(f"Consonants left: {' '.join(consonants)}")

# martian_explorer

SIZE = 6
mars = []
deposits = {"W": ["Water", 0], "M": ["Metal", 0], "C": ["Concrete", 0]}
directions = {
    "left": lambda r, c: [r, (c - 1) % SIZE],
    "right": lambda r, c: [r, (c + 1) % SIZE],
    "up": lambda r, c: [(r - 1) % SIZE, c],
    "down": lambda r, c: [(r + 1) % SIZE, c]
}

rover_pos = []

for row in range(SIZE):
    current_row = input().split()

    if "E" in current_row:
        rover_pos = [row, current_row.index("E")]

    mars.append(current_row)

commands = input().split(", ")

for command in commands:
    rover_pos = directions[command](*rover_pos) # Подаваме на функцията повече от 1 параметър
    position = mars[rover_pos[0][rover_pos[1]]]

    if position in deposits:
        print(f"{deposits[position[0]]} deposit found at ({rover_pos[0]}, {rover_pos[1]})")

        deposits[position][1] += 1

    elif position == "R":
        print(f"Rover got broken at({rover_pos[0]}, {rover_pos[1]})")

if all([deposits["W"][1], deposits["M"][1], deposits["C"][1]]):
    print("Area suitable to start the colony.")
else:
    print("Area not suitable to start the colony.")


# naughty_or_nice
def naughty_or_nice(santa_list, *args, **kwargs):
    nice_kids, naughty_kids = [], []
    result = []

    def place_kid():
        if len(kids) == 1:
            nice_kids.append(kids[0][1]) if type_of_kid == "Nice" else naughty_kids.append(kids[0][1])
            santa_list.remove([0])



    for kid_data in args:
        number, type_of_kid = kid_data.split("-")
        kids = [info for info in santa_list if info[0] == int(number)]
        place_kid()

    for name, type_of_kid in kwargs.items():
        kids = [info for info in santa_list if info[1] == name]
        place_kid()

    if nice_kids:
        result.append(f"Nice: {', '.join(nice_kids)}")
    if naughty_kids:
        result.append(f"Naughty: {', '.join(naughty_kids)}")
    if santa_list:
        result.append(f"Not found:: {', '.join(k[1] for k in santa_list)}")

    return "\n".join(result)

