STACK_VOWEL = "euioay"
STACK_VOWER_UPPER = ''.join([x.upper() for x in STACK_VOWEL])


def generator_vowel(*args, **kwargs):
    tuple_vowel = args[0]
    for row in tuple_vowel:
        for letter in row:
            if letter.lower() in STACK_VOWEL:
                yield row
                break


def closure(n_vowel):
    def wrapper(*args, **kwargs):
        tuple_vowel = args[0]
        for row in tuple_vowel:
            counter_letter = 0
            for letter in row:
                if letter.lower() in STACK_VOWEL:
                    counter_letter += 1
            if counter_letter >= n_vowel:
                yield row

    return wrapper


def generator_upper(*args, **kwargs):
    arr_upper = args[0]
    for row in arr_upper:
        for letter in row:
            if letter.isupper():
                yield row
                break


