$(document).ready(function() {
    updateUsersTable();

    setInterval(updateUsersTable, 1000);

    var contextMenu = $('.context-menu');
    var isMenuOpen = false;

    $('#users-table').on('contextmenu', 'tr', function(e) {
        e.preventDefault();

        var mouseX = e.pageX;
        var mouseY = e.pageY;

        if (isMenuOpen) {
            var currentX = parseInt(contextMenu.css('left'));
            var currentY = parseInt(contextMenu.css('top'));
            var deltaX = mouseX - currentX;
            var deltaY = mouseY - currentY;

            contextMenu.removeClass('animate-menu').animate({
                left: '+=' + deltaX + 'px',
                top: '+=' + deltaY + 'px'
            }, 200);
        } else {
            contextMenu.css({
                display: 'block',
                left: mouseX,
                top: mouseY
            }).addClass('animate-menu');
        }

        isMenuOpen = true;

        contextMenu.on('click', 'li', function() {
            const menuItem = $(this).text();
            alert('Selected: ' + menuItem);
            contextMenu.hide();
            isMenuOpen = false;
        });
    });

